import "../css/post.css";

function Post({post}) {
    return (
        <div
            key={post.postId}
            className="post" style={{backgroundImage:`url(${post.thumbnail})`}}
            onClick={() => {window.open(post.url)}}
        >
            <div className="top">

            </div>
            <div className="bottom">
                <div>{post.title}</div>
                <div>{post.closingDate}</div>
                <div>
                    {post.conditions.map(c => <span>{c}</span>)}
                </div>
            </div>
        </div>
    )
}

export default Post;
